import axios from 'axios';

export const loadWorkouts = ( token ) => {
    return dispatch => {
        axios.get('/api/workouts/', {
            headers: {
                'auth-token' : token
            }
        })
        .then( res => {
            console.log(res.data);
        })
        .catch( err => {

        });
    };
};
